        $_SESSION['correctBreak']=0;
        $_SESSION['correctTotal']=0;
        $_SESSION['correctOver']=0;
    }

    function db_connect(){
        try {
            $pdo = new PDO('mysql:dbname=worklogs;host=localhost', 'root', '');
            $pdo->setAttribute(PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION);
        } catch (PDOException $e) {
            $error_message[] = $e->getMessage();
            echo "接続に失敗";
        }
        return $pdo;
    }
    function inverse(){
        $_SESSION['startBool']=!$_SESSION['startBool']; 
        $_SESSION['endBool'] =!$_SESSION['endBool']; 
        $_SESSION['breakBool'] =!$_SESSION['breakBool']; 
    }
